import logo from './logo.svg';
import './App.scss';
import { Routes } from 'react-router-dom'
import { Route } from 'react-router-dom'
import Layout from './rcomponents/Layout'

function App() {
  return (
    <>
    <Routes>
      <Route path="/" elements={<Layout />} />
    </Routes>
    </>
  )
}

export default App
